import {
    FormControl,
    InputLabel,
    Select,
    MenuItem,
    IconButton,
  } from "@mui/material";
  import LoanIconButton from "../../Common/LoanIconButton";
  import CompanyModal from "../Common/CompanyModal";
  import { RiSkipBackMiniFill } from "react-icons/ri";
  import { BsPlus } from "react-icons/bs";
  import { BiSkipNext, BiSkipPrevious } from "react-icons/bi";
  import { useState } from "react";
  import { IoRefresh } from "react-icons/io5";
  import LoanTextField from "../../Common/LoanTextField";
  const AddAccountDetail = ({
    // submitted,
    accountDetial,
    // handleBack,
    handleSkip,
    // handleNext,
    // newAccountDetials,
    
handleInputChangeAccountDetial,
saveAccountDetials,
  }) => {
    const [isAccountDetialModalOpen, setIsAccountDetialModalOpen] =
      useState(false);
    function handleAccountDetialOpenModal() {
      setIsAccountDetialModalOpen(true);
    }
    function handleAccountDetialCloseModal() {
      setIsAccountDetialModalOpen(false);
    }
    return (
      <>
        <div className="flex">
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BiSkipPrevious />}
            text="Back"
            onClick={handleSkip}
          />
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BsPlus />}
            text="Add"
            onClick={handleAccountDetialOpenModal}
          />
          <LoanIconButton
            style={{ color: "purple" }}
            icon={<BiSkipNext />}
            text="Skip"
            onClick={handleSkip}
          />
        </div>
        <CompanyModal
          isOpen={isAccountDetialModalOpen}
          onClose={handleAccountDetialCloseModal}
          title="Add company account details "
        >
          <div>
            <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
             <LoanTextField
                id="CustomerId"
                label="Customer Id"
                value={accountDetial.CustomerId}
                onChange={handleInputChangeAccountDetial}
                name="CustomerId"
              />
              <LoanTextField
                id="DepositAccount"
                label="DepositAccount"
                value={accountDetial.DepositAccount}
                onChange={handleInputChangeAccountDetial}
                name="DepositAccount"
              />
              <LoanTextField
                id="DepositBalance"
                label="DepositBalance"
                value={accountDetial.DepositBalance}
                onChange={handleInputChangeAccountDetial}
                name="DepositBalance"
              />
            </div>
            <div className="flex justify-center p-2 pt-5">
              <button
                className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                onClick={() => {
                  saveAccountDetials();
                }}
              >
                Save
              </button>
            </div>
          </div>
        </CompanyModal>
      </>
    );
  };  
  export default AddAccountDetail;
